var data = {
    plots: babyNames,
    current_plot: 0,
    plot_progress: 0,
    guess: [],
    guess_submitted: false,
    canvas_width: 900,
    canvas_height: 400,
    animate: true,
    x_start: 80,
    x_end: 850,
    x_offset: 77,
    y_start: 330,
    y_end: 30,
    y_offset: 30,
    real_x: [],
    real_y: [],
    user_y: [],
    score: -1
}

new Vue({
    el: '#plot_info',
    data: function () {
        return data;
    }
})
new Vue({
    el: '#controls',
    data: function () {
        return data;
    },

    methods: {
        clear() {
            this.guess = [];
            this.plot_progress = 0;
            this.guess_submitted = false;
            this.real_x = [];
            this.real_y = [];
            this.user_y = [];
            this.score = -1;
            this.animate = true;
        },
        next() {
            this.current_plot = Math.floor(this.map(Math.random(),0,1,0,this.plots.length));
            /* FOR PLOTS TO BE DISPLAYED IN SPECIFIC ORDER
            if (this.current_plot < this.plots.length-1) {
                this.current_plot++;
            } else {
                this.current_plot = 0;
            }*/
            this.clear();
        },
        map(n, start1, stop1, start2, stop2) {
            return ((n-start1)/(stop1-start1))*(stop2-start2)+start2;
        },
        submit() {
            if (this.guess.length > 0) {
                var known_points = [];
                //find all known points in users guess
                for (i=0;i<this.guess.length;i++) {
                    if (this.guess[i]) {
                        known_points.push(i);
                    } 
                }
                //interpolate users guess for all points in plot
                for (i=0;i<known_points.length-1;i++) {
                    var num_unknown_points = known_points[i+1] - known_points[i];
                    for (j=1;j<num_unknown_points;j++) {
                        this.guess[known_points[i]+j] = this.map(j+1,1,num_unknown_points + 1,this.guess[known_points[i]],this.guess[known_points[i+1]])
                    }
                }
                //to give user benefit of doubt when not quite starting the curve at x=0, extrapolate their closest point (if within 20 pixels) as x=0
                if (!this.guess[0]) {
                    for (i=0;i<20;i++) {
                        if (this.guess[i]) {
                            this.guess[0] = this.guess[i];
                            this.guess_submitted = true;
                            return
                        } 
                    }
                }
                this.animate = true;
                this.guess_submitted = true;
            }
        }
    }

});
new Vue({
        el: '#app',
        data: function () {
            return data;
        },
        methods: {
            setup(sketch) {
                sketch.createCanvas(this.canvas_width, this.canvas_height);
            },

            draw(sketch) {
                if (this.animate) {
                    var this_plot = this.plots[this.current_plot]
                    sketch.background(37, 39, 40);
                    //axes - constant for every graph
                    sketch.fill(255, 255, 255);
                    sketch.stroke(255);
                    sketch.strokeWeight(2);
                    sketch.line(80, 30, 80, 330);
                    sketch.line(80, 330, 850, 330);
                    sketch.noStroke();
                    sketch.textAlign(sketch.CENTER)
                    sketch.textSize(14);
                        
                    sketch.text(this_plot.x_label, 450, 385);
                    if (this.plots != babyNames){    
                        sketch.push();
                        sketch.translate(20, 180);
                        sketch.rotate(-3.14/2);
                    sketch.text(this_plot.y_label, 0, 0);
                        sketch.pop();
                    } else {
                        sketch.push();
                        sketch.translate(60, 180);
                        sketch.rotate(-3.14/2);
                    sketch.text(this_plot.y_label, 0, 0);
                        sketch.pop();
                    }

                    //numbering axes
                    sketch.textSize(12);
                    //x axis
                    this.x_offset = (this.x_end-this.x_start)/(this_plot.x_axis.length - 1)
                    for (i=0; i<this_plot.x_axis.length; i++) {
                        //tick marks
                        sketch.stroke(255);
                        sketch.strokeWeight(1);
                        sketch.line(this.x_start+(this.x_offset*i), this.y_start, this.x_start+(this.x_offset*i), this.y_start+5)
                        //labels
                        sketch.noStroke();
                        sketch.text(this_plot.x_axis[i].toString(), this.x_start+(this.x_offset*i), this.y_start+20);
                    }
                    //y axis
                    if(this.plots != babyNames){
                        this.y_offset = (this.y_start-this.y_end)/(this_plot.y_axis.length - 1)
                        for (i=0; i<this_plot.y_axis.length; i++) {
                            //tick marks
                            sketch.stroke(255);
                            sketch.strokeWeight(1);
                            sketch.line(this.x_start, this.y_start-(this.y_offset*i), this.x_start-5, this.y_start-(this.y_offset*i))
                            //labels
                            sketch.noStroke();
                            sketch.text(this_plot.y_axis[i].toString(), this.x_start-20, this.y_start-(this.y_offset*i));
                        }
                    }

                    //baby name peak
                    if(this.plots = babyNames){
                        sketch.stroke(255);
                        sketch.strokeWeight(1);
                        var y_array = this.plots[this.current_plot].y_values;
                        var y_ax = this.plots[this.current_plot].y_axis;
                        var peak = y_array.reduce(function(a, b) {
                            return Math.max(a, b);
                        });
                        var y = sketch.map(peak,0,y_ax[y_ax.length-1], this.y_start, this.y_end);
                        //sketch.line(this.x_start,y,this.x_end,y);
                        for (l=0;l<(this.x_end-this.x_start);l+=5){
                            sketch.ellipse(this.x_start + l, y, 1)
                        }
                        sketch.noStroke();
                        sketch.text("Peak Popularity", this.x_start + (this.x_end-this.x_start)/2,y-5)
                        
                    }
                    if (this.guess_submitted) {
                        var x_points = this.plots[this.current_plot].x_values;
                        var x_ax = this.plots[this.current_plot].x_axis;
                        var y_points = this.plots[this.current_plot].y_values;
                        var y_ax = this.plots[this.current_plot].y_axis;

                        sketch.strokeWeight(2);
                        for(i=0;i<x_points.length;i++) {
                            //PLOT REAL DATA BARS
                            sketch.stroke(120);
                            var x =sketch.map(x_points[i],x_ax[0],x_ax[x_ax.length-1], this.x_start, this.x_end);
                            var y = sketch.map(y_points[i],y_ax[0],y_ax[y_ax.length-1], this.y_start, this.y_end);
                            this.real_x.push(x);
                            this.real_y.push(y);
                            sketch.line(x, this.y_start, x, y);
                            
                            //OVERLAY GUESS DIFFERENCE BARS
                            var guess_y = this.guess[Math.floor(x-this.x_start)];
                            this.user_y.push(guess_y);
                            var blue = sketch.color(36,237,218);
                            var yellow = sketch.color(252,185,18);
                            if (guess_y && guess_y > y) {
                                sketch.stroke(blue);
                                sketch.line(x, this.y_start, x, guess_y);
                            } else if (guess_y) {
                                sketch.stroke(blue);
                                sketch.line(x,this.y_start,x,y)
                                sketch.stroke(yellow);
                                sketch.line(x,y,x,guess_y)
                            } 
                        }
                        // PLOT USER'S GUESS
                        if (i == x_points.length){
                            sketch.strokeWeight(2);
                            var last_n = 0;
                            for(n=0;n<this.x_end-this.x_start;n++) {
                                if (this.guess[n]) {
                                    var thing = sketch.map(this.guess[n], 30, 330,200,65)
                                    sketch.stroke(thing);
                                    sketch.line(this.x_start+last_n, this.guess[last_n], this.x_start+n, this.guess[n]);
                                    last_n = n;
                                } 
                            } 
                        }   
                        //PLOT REAL DATA LINE
                        sketch.strokeWeight(3);
                        for (i=0;i<(x_points.length)-1;i++){
                            sketch.stroke(255);
                            sketch.line(this.real_x[i],this.real_y[i],this.real_x[i+1],this.real_y[i+1])
                        }
                        
                        //SCORE CALCULATION
                        
                        var user_score = 0;
                        var random_score = 0;
                        var random_replicates = 500;
                        for (i=0;i < x_points.length ;i++) {
                            var random_guess = sketch.map(Math.random(),0,1,this.y_start,this.y_end);
                            for (j=0; j < random_replicates ;j++) {
                                random_guess = sketch.map(Math.random(),0,1,this.y_start,this.y_end);
                                random_score += (this.real_y[i] - random_guess)*(this.real_y[i] - random_guess);
                            }
                            if (this.user_y[i]) {
                                user_score += (this.real_y[i] - this.user_y[i])*(this.real_y[i] - this.user_y[i]);
                                //except for areas where user didn't input anything. then add max error
                            } else {
                                var dist_to_bttm = (this.real_y[i] - this.y_start)*(this.real_y[i] - this.y_start);
                                var dist_to_top = (this.real_y[i] - this.y_end)*(this.real_y[i] - this.y_end);
                                user_score += 0.25*Math.max(dist_to_bttm, dist_to_top);
                            }
                        };
                        random_score = random_score/random_replicates;

                        this.score = sketch.map(user_score,0,random_score,100,0);
                        this.score = this.score.toFixed(1)
                        this.animate = false;
                        
                    } else if (!this.guess_submitted){
                        // PLOT USER'S GUESS
                        sketch.strokeWeight(2);
                        var last_i = 0;
                        for(i=0;i<this.guess.length;i++) {
                            if (this.guess[i]) {
                                var thing = sketch.map(this.guess[i], 30, 330,200,65)
                                sketch.stroke(thing);
                                sketch.line(this.x_start+last_i, this.guess[last_i], this.x_start+i, this.guess[i]);
                                last_i = i;
                            } 
                        }    
                    } 
                }
            },
            mousedragged(sketch) {
                if (sketch.mouseX < this.x_end + 20 
                    && Math.floor(sketch.mouseX)-this.x_start > this.plot_progress 
                    && sketch.mouseX > this.x_start - 40 
                    && sketch.mouseY < this.y_start 
                    && sketch.mouseY > this.y_end) {
                    this.guess[Math.floor(sketch.mouseX-this.x_start)] = Math.floor(sketch.mouseY);
                    this.plot_progress = Math.floor(sketch.mouseX)-this.x_start;
                }
            },
            mousepressed(sketch) {
                if (sketch.mouseX < this.x_end + 20 
                    && Math.floor(sketch.mouseX)-this.x_start > this.plot_progress 
                    && sketch.mouseX > this.x_start - 40 
                    && sketch.mouseY < this.y_start 
                    && sketch.mouseY > this.y_end) {
                    this.guess[Math.floor(sketch.mouseX-this.x_start)] = Math.floor(sketch.mouseY);
                    this.plot_progress = Math.floor(sketch.mouseX)-this.x_start;
                }
                
            }
        }
    });